DROP TABLE IF EXISTS `FAMILIES`;
CREATE TABLE IF NOT EXISTS `FAMILIES` (
  `id` int PRIMARY KEY,
  `prod` TEXT,
  `fam` TEXT,
  `subfam` TEXT,
  `showsubfam` INT NOT NULL DEFAULT 0,
  `failrate` float NOT NULL DEFAULT 0,
  `business` INT NOT NULL DEFAULT 0
);


DROP TABLE IF EXISTS `MODEL`;
CREATE TABLE IF NOT EXISTS `MODEL` (
  `id` int PRIMARY KEY,
  `model` TEXT,
  `submodel` TEXT,
  `idfam` int NOT NULL DEFAULT 0,
  `prod` TEXT,
  `cpu` TEXT,
  `display` TEXT,
  `mem` TEXT,
  `hdd` TEXT,
  `shdd` TEXT,
  `gpu` TEXT,
  `wnet` TEXT,
  `odd` TEXT,
  `mdb` TEXT,
  `chassis` TEXT,
  `acum` TEXT,
  `warranty` TEXT,
  `sist` TEXT,
  `msc` TEXT,
  `ldate` TEXT,
  `link` TEXT,
  `link2` TEXT,
  `inactive` INT NOT NULL DEFAULT 0,
  `img_1` TEXT,
  `img_2` TEXT,
  `img_3` TEXT,
  `img_4` TEXT,
  `keywords` TEXT,
  `regions` TEXT,
  `idabc` int NOT NULL DEFAULT 0,
  `p_model` int DEFAULT NULL,
  `show_smodel` int NOT NULL DEFAULT 0,
  `tags` TEXT,
  `extra_modelname` TEXT
);

